import React from "react";
import "./Medical.css";

function Medical() {
  return (
    <div className="medical-1">
      <img
        className="icon-bluetooth"
        src="https://anima-uploads.s3.amazonaws.com/projects/6492c55c74995fc792d0df14/releases/6493fbc959e3e5a943ada352/img/ion-medical.svg"
        alt="icon-bluetooth"
      />
    </div>
  );
}

export default Medical;
